import React from "react";
import "../../styles/FeedBackPageStyles/FeedbackSafetyMeasureCard.css";
const NoSafetyMeasureCard = ({ img, description, toggleNoSafetyMeasures }) => {
  return (
    <div className="feedback_safetymeasure_card">
      <div>
        <img src={img} alt="" />
        <input
          onClick={() => toggleNoSafetyMeasures()}
          type="checkbox"
          className="safetymeasure_card_checkbox"
        />
      </div>
      <p>{description}</p>
    </div>
  );
};

export default NoSafetyMeasureCard;
